import React from 'react'
import './App.css';
import './Menu'
import Main from './Main'
import Menu from './Menu';
import { useHistory } from "react-router-dom"

function App() {
  let navigate = useHistory ();
  return (
    <div className="app">



      <Menu />


      <Main />

      <button className="btn" 
                onClick={()=>{
                    navigate("./Login")
                }}
                >Sign In</button>

    </div>
  );
}

export default App;
